import React from "react";
import styled from "styled-components";
import img from "../images/disney-hotstar-logo-dark.svg";
import MenuIcon from "@mui/icons-material/Menu";
const Header = () => {
  return (
    <>
      <NavContainer>
        <LeftMenu>
          <MenuBar>
            <MenuIcon />
          </MenuBar>
          <Logo>
            <img src={img} alt="asa" />
          </Logo>
          <NavLinks>
            <a href="#">TV</a>
            <a href="#">Movies</a>
            <a href="#">Sports</a>
            <a href="#">Disney+</a>
          </NavLinks>
        </LeftMenu>
        <RightMenu></RightMenu>
      </NavContainer>
    </>
  );
};

export default Header;

const NavContainer = styled.div`
  position: fixed;
  margin: 0 auto;
  margin-top: 6px;
  top: 0;
  left: 0;
  display: flex;
  flex-direction: row;
  justify-content: space-around;
  align-items: center;
  height: 72px;
  padding: 0 50px;
  background-color: #121926;
  width: 100vw;
  font-family: "Roboto", "HelveticaNeue-Light", sans-serif;
`;
const LeftMenu = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: space-around;

  min-height: 72px;
`;
const NavLinks = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: space-around;

  a {
    text-decoration: none;
    color: #ffffffcc;
  }
`;
const RightMenu = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: space-around;

  min-height: 72px;
`;
const MenuBar = styled(MenuIcon)`
  color: #ffffff99;
`;
const Logo = styled.div``;
